#! /usr/bin/env python3

import base64
import bz2


def returnLicense():
    """

    :return:
    :rtype:
    """
    licenseText = b''
    return bz2.decompress(base64.decodebytes(licenseText)).decode('utf-8')


def outputLicense():
    """

    """
    print(returnLicense())


if __name__ == "__main__":
    outputLicense()
